import React from "react";
import "./Navbar.css";
import Router from "./Router";

export default function Navbar() {
  return (
    <div>
      <ul>
        <li>Home</li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
      <Router></Router>
    </div>
  );
}
